import React, { Component } from 'react';

class TestContainer extends Component {

  componentDidMount() {
    fetch('/users/sign_out', {
      method: 'DELETE'
    }).then(() => {
       console.log('removed');
    }).catch(err => {
      console.error(err)
    });
  }

  render(){
    return (
      <div>
      hello from test
      </div>
    )
  }
}

export default TestContainer;
